using JetBrains.Annotations;
using System;
using System.Collections;
using System.Collections.Generic;
using System.Linq;
using UnityEngine;
using UnityEngine.UI;

[RequireComponent(typeof(ControlMessageInterceptor))]
public class PlayerPanelManager : MonoBehaviour
{
    [Range(0, 100)]
    public float panelWidth = 30, panelHeight = 100;
    public TextAnchor ancor;
    public Color backgroundColor;
    public GameObject playerInfoBoard;
    [Min(1)]
    public int numcolumn = 1;
    [Range(1, 10)]
    [Tooltip("Can differ if the area of the panel is too small to accomodate clearly all the columns")]
    public int numOfVisiblePlayers = 4;
    public GridLayoutGroup.Corner origin;
    public bool showOnlyCalledPlayers = false;
    public Color ActivePlayerColor, InactivePlayerColor;

    private Image background;
    private RectTransform rect;
    private GridLayoutGroup grid;
    private RectTransform scrollcontent;

    private float shift;
    private int currentplayerindex = 0;
    private int indexlastcalledplayer = -1;
    public Vector3 targetPosition;

    // Start is called before the first frame update
    void Start()
    {
        rect = GetComponent<RectTransform>();
        GameObject bg = GameObject.Instantiate(new GameObject("Backgroung", typeof(RectTransform)), transform);
        background = bg.AddComponent<Image>();
        bg.GetComponent<RectTransform>().sizeDelta = rect.sizeDelta;
        bg.GetComponent<RectTransform>().anchorMax = Vector2.one;
        bg.GetComponent<RectTransform>().anchorMin = Vector2.zero;
        background.color = backgroundColor;
        ScrollRect scroll = bg.AddComponent<ScrollRect>();
        scroll.movementType = ScrollRect.MovementType.Clamped;

        GameObject scrollcontainer = GameObject.Instantiate(new GameObject("Player Scroller", typeof(RectTransform)), bg.transform);
        scrollcontainer.GetComponent<RectTransform>().sizeDelta = rect.sizeDelta;
        scrollcontainer.GetComponent<RectTransform>().anchorMax = Vector2.one;
        scrollcontainer.GetComponent<RectTransform>().anchorMin = Vector2.zero;
        Image image = scrollcontainer.AddComponent<Image>();
        image.sprite = Resources.Load<Sprite>("UI/Square");
        Mask m = scrollcontainer.AddComponent<Mask>();
        m.showMaskGraphic = false;
        
        GameObject scrollcontentobj = GameObject.Instantiate(new GameObject("Player Panel Conteiner", typeof(RectTransform)), scrollcontainer.transform);
        scrollcontent = scrollcontentobj.GetComponent<RectTransform>();
        scrollcontent.sizeDelta = rect.sizeDelta;
        scroll.content = scrollcontent;
        grid = scrollcontentobj.AddComponent<GridLayoutGroup>();
        
        rect.anchoredPosition = Vector2.zero;
        rect.anchorMax = Vector2.one * 0.5f;
        rect.anchorMin = Vector2.one * 0.5f;
        Vector2 screensize = transform.parent.GetComponent<RectTransform>().sizeDelta;
        rect.sizeDelta = Vector2.Scale(screensize, new Vector2(panelWidth/100, panelHeight/100));
        Vector2 position = Vector2.zero;
        switch (ancor)
        {
            case TextAnchor.UpperLeft:
                position = new Vector2(-screensize.x / 2, screensize.y / 2) - new Vector2(-rect.sizeDelta.x * 0.5f, rect.sizeDelta.y * 0.5f);
                break;
            case TextAnchor.UpperCenter:
                position = new Vector2(0, screensize.y / 2) - new Vector2(0, rect.sizeDelta.y * 0.5f);
                break;
            case TextAnchor.UpperRight:
                position = new Vector2(screensize.x / 2, screensize.y / 2) - new Vector2(rect.sizeDelta.x * 0.5f, rect.sizeDelta.y * 0.5f);
                break;
            case TextAnchor.MiddleLeft:
                position = new Vector2(-screensize.x / 2, 0) - new Vector2(-rect.sizeDelta.x * 0.5f, 0);
                break;
            case TextAnchor.MiddleCenter:
                position = Vector2.zero;
                break;
            case TextAnchor.MiddleRight:
                position = new Vector2(screensize.x / 2, 0) - new Vector2(rect.sizeDelta.x * 0.5f, 0);
                break;
            case TextAnchor.LowerLeft:
                position = new Vector2(-screensize.x / 2, -screensize.y / 2) - new Vector2(-rect.sizeDelta.x * 0.5f, -rect.sizeDelta.y * 0.5f);
                break;
            case TextAnchor.LowerCenter:
                position = new Vector2(0, -screensize.y / 2) - new Vector2(0, -rect.sizeDelta.y * 0.5f);
                break;
            case TextAnchor.LowerRight:
                position = new Vector2(screensize.x / 2, -screensize.y / 2) - new Vector2(rect.sizeDelta.x * 0.5f, -rect.sizeDelta.y * 0.5f);
                break;
            default:
                break;
        }
        rect.anchoredPosition = position;
        grid.constraint = GridLayoutGroup.Constraint.FixedColumnCount;
        grid.constraintCount = numcolumn;
        grid.startCorner = origin;
        grid.childAlignment = ancor;
        

        if (GameSetting.instance != null)
        {
            SetUpListOfPlayers(GameSetting.instance.players);
        }
        else
        {
            List<Player> pl = new List<Player>();
            for (int i = 0; i < 10; i++)
            {
                Player p = new Player();
                p.id = i;
                p.name = "Player " + i;
                p.surname = "Surname " + i;
                p.phonema = "";
                p.avatar = "";
                pl.Add(p);
            }
            SetUpListOfPlayers(pl);
            setActivePlayer(pl.ElementAt(0).id);
        }

        ControlMessageInterceptor.ReceiveNewPlayer += setActivePlayer;
    }

    void Update()
    {
        if (Vector3.Distance(scrollcontent.localPosition, targetPosition) > 0.05f)
        {
            scrollcontent.localPosition = Vector3.Lerp(scrollcontent.localPosition, targetPosition, 2 * Time.deltaTime);
        }
    }

    public void setActivePlayer(int id)
    {
        for (int i = 0; i < grid.transform.childCount; i++) {
            if (grid.transform.GetChild(i).name == GameSetting.instance.players.FirstOrDefault(x => x.id == id).name)
            {
                if (showOnlyCalledPlayers)
                {
                    if (!grid.transform.GetChild(i).GetComponent<PlayerPersonalPanel>().hasBeenCalled)
                    {
                        indexlastcalledplayer++;
                        grid.transform.GetChild(i).SetSiblingIndex(indexlastcalledplayer);
                        grid.transform.GetChild(indexlastcalledplayer).gameObject.SetActive(true);
                        grid.transform.GetChild(indexlastcalledplayer).GetComponent<PlayerPersonalPanel>().setAsActivePlayer(true, ActivePlayerColor);
                        currentplayerindex = indexlastcalledplayer;
                    }
                    else {
                        grid.transform.GetChild(i).GetComponent<PlayerPersonalPanel>().setAsActivePlayer(true, ActivePlayerColor);
                        currentplayerindex = i;
                    }
                    
                }
                else
                {
                    grid.transform.GetChild(i).GetComponent<PlayerPersonalPanel>().setAsActivePlayer(true, ActivePlayerColor);
                    currentplayerindex = i;
                }
            }
            else {
                grid.transform.GetChild(i).GetComponent<PlayerPersonalPanel>().setAsActivePlayer(false, InactivePlayerColor);
            }

            targetPosition = -scrollcontent.sizeDelta * 0.5f + new Vector2(0, shift) * (int)((currentplayerindex + 1) / numcolumn);
        }
    }

    private void SetUpListOfPlayers(List<Player> obj)
    {
        float aspectratio = playerInfoBoard.GetComponent<RectTransform>().sizeDelta.y / playerInfoBoard.GetComponent<RectTransform>().sizeDelta.x;
        float heightOfPlayerPanel = aspectratio * (Screen.width / 2) * panelWidth / (100 * numcolumn);
        
        grid.spacing = new Vector2(rect.sizeDelta.x * 0.05f / numcolumn, Mathf.Abs((Screen.height*panelHeight/100 - heightOfPlayerPanel*numOfVisiblePlayers))*numcolumn /(numOfVisiblePlayers*2f));
        
        grid.cellSize = new Vector2(rect.sizeDelta.x * 0.9f / numcolumn, heightOfPlayerPanel);
        scrollcontent.sizeDelta = new Vector2(rect.sizeDelta.x, (heightOfPlayerPanel + grid.spacing.y)*(obj.Count / numcolumn));
        shift = grid.spacing.y + grid.cellSize.y;
        foreach (Player p in obj) {
            GameObject g = GameObject.Instantiate(playerInfoBoard, grid.transform);
            g.name = p.id.ToString();
            if (g.GetComponent<PlayerPersonalPanel>() != null) {
                g.GetComponent<PlayerPersonalPanel>().SetUp(p);
                if (showOnlyCalledPlayers) {
                    g.SetActive(false);
                }
            }
        }
    }
}


public enum AnchoringPosition { 
    Top_Right, Top_left, Top_Center, Center_Right, Center_left, Center_Center, Bottom_Right, Bottom_left, Bottom_Center
}
